dden; // just a surface work. You should find the reason than abuse this features.\r\n  }\r\n  \r\n  &.resp-width{\r\n    margin: 0 auto;\r\n    max-width: 100%;\r\n    // default laptop width\r\n    &{\r\n      width: 72%;\r\n    }\r\n    // 4k or extreme wide screen.\r\n    @media (min-width: 1920px) {\r\n      &{\r\n        width: 66%;\r\n      }\r\n    }\r\n    // Widden than normal laptop screen\r\n    @media (min-width: 1620px) {\r\n      &{\r\n        width: 72%;\r\n      }\r\n    }\r\n    /**\r\n    * 1264px - 1620px\r\n    * Medium (laptop) \r\n    * The default laptop viewpoint Field.\r\n    * No need to do specific media query.\r\n    */\r\n    // tablet large\r\n    @media (max-width: 1264px){\r\n      &{\r\n        width: calc(86% - 12px);\r\n      }\r\n    }\r\n    // tablet small\r\n    @media (max-width: 967px){\r\n      &{\r\n        width: calc(92% - 12px);\r\n      }\r\n    }\r\n    // mobile Field. \r\n    @media (max-width: 567px) {\r\n      &{\r\n        width: calc(100% - 12px);\r\n      }\r\n    }\r\n  }\r\n}\r\n// distinguishing span and div.\r\nspan.layout{\r\n  &.vh-center{\r\n    vertical-align: middle;\r\n  }\r\n  &.vw-center{\r\n    // It is a fallacy\r\n    text-align: center;\r\n  }\r\n}\r\ndiv.layout{\r\n  &.vh-center{\r\n    display: flex;\r\n    align-items: center\r\n  }\r\n  &.vw-center{\r\n    margin-left: auto;\r\n    margin-right: auto;\r\n  }\r\n}","/**\r\n * For better various type of global size controll\r\n */\r\n\r\n// rem font-size.\r\nhtml, body{\r\n  font-size: 16px;  \r\n  // 4k or extreme wide screen.\r\n  @media (min-width: 1920px) {\r\n    &{\r\n      font-size: 18px;\r\n    }\r\n  }\r\n  // Widden than normal laptop screen\r\n  @media (min-width: 1620px) {\r\n    &{\r\n      font-size: 17px;\r\n    }\r\n  }\r\n  /**\r\n  * 1264px - 1620px\r\n  * Medium (laptop) \r\n  * The default laptop viewpoint Field.\r\n  * No need to do specific media query.\r\n  */\r\n  // tablet large\r\n  @media (max-width: 1264px){\r\n    &{\r\n      font-size: 15px;\r\n    }\r\n  }\r\n  // tablet small\r\n  @media (max-width: 967px){\r\n    &{\r\n      font-size: 15px;\r\n    }\r\n  }\r\n  // mobile Field. \r\n  @media (max-width: 567px) {\r\n    &{\r\n      font-size: 14px;\r\n    }\r\n  }\r\n  @media (max-width: 380px) {\r\n    &{\r\n      font-size: 13px;\r\n    };\r\n  }\r\n}\r\n","/**\r\n * Layout.\r\n * Start from `.layout`, end with `.wrap`.\r\n */\r\n@import './layout/justify.scss';\r\n@import './layout/size.scss';\r\n\r\n$debugColor: violet;\r\n\r\n/**\r\n * Layout Standards.\r\n * Each type of layout element should have a `.layout` class\r\n * And ought to be an non-semantic element which could be: div、 span. \r\n */\r\n\r\n.layout{\r\n  .wrap{\r\n    margin: 0;\r\n    padding: 0;\r\n    width: 100%;\r\n    // show the msg\r\n    &.debug{\r\n      border: 1px solid $debugColor;\r\n    }\r\n  }\r\n}\r\n\r\n.debug{\r\n  // sibling to layout\r\n  &.layout{\r\n    .wrap{\r\n      border: 1px solid $debugColor;\r\n    }\r\n  }\r\n  // debug by globally\r\n  .layout{\r\n    .wrap{\r\n      border: 1px solid $debugColor;\r\n    }\r\n  }\r\n}\r\n",".block-fullscreen {\r\n  position : fixed;\r\n  top      : 0;\r\n  max-width: 100%;\r\n  height   : 100%;\r\n  min-width: 98%;\r\n  z-index  : 9999;\r\n  margin   : 0;\r\n  animation: elastic 1s\r\n}\r\n\r\n.lzyColorful {\r\n  font-weight            : 900;\r\n  border                 : 1px solid #b1adad;\r\n  // text-stroke            : 1px transparent;\r\n  -webkit-text-stroke    : 1px transparent;\r\n  background-image       : linear-gradient(left, #16bbe6, #ffc100 25%, rgb(196, 30, 30) 50%, rgb(41, 197, 111) 75%, rgb(209, 23, 221), rgb(212, 19, 19) 97%);\r\n  background-image       : -webkit-linear-gradient(left, #16bbe6, #ffc100 25%, rgb(196, 30, 30) 50%, rgb(41, 197, 111) 75%, rgb(209, 23, 221), rgb(212, 19, 19) 97%);\r\n  -webkit-text-fill-color: transparent;\r\n  background-clip: text;\r\n  -webkit-background-size: 200% 100%;\r\n  background-size        : 200% 100%;\r\n  -webkit-animation      : lzyBGTrsf 4s infinite;\r\n  animation              : lzyBGTrsf 4s linear infinite;\r\n}\r\n/**\r\n * Hue the color with delay.\r\n */ \r\n@keyframes hue{\r\n  0% {\r\n    filter: hue-rotate(0deg);\r\n  }\r\n  10% {\r\n    filter: hue-rotate(0deg);\r\n  }\r\n  100% {\r\n    filter: hue-rotate(-360deg);\r\n  }\r\n}\r\n@keyframes lzyBGTrsf {\r\n  0% {\r\n    background-position: 0 0;\r\n  }\r\n  100% {\r\n    background-position: -200% -100%;\r\n  }\r\n}\r\n\r\n@keyframes elastic {\r\n  0% {\r\n    transform: scale(0)\r\n  }\r\n  55% {\r\n    transform: scale(1)\r\n  }\r\n  70% {\r\n    transform: scale(.98)\r\n  }\r\n  100% {\r\n    transform: scale(1)\r\n  }\r\n}","/**\r\n * Customed css animations\r\n */\r\n@import './animations/flip.scss';\r\n@import './animations/transitions.scss';\r\n\r\n/* \r\n// knock off all the animation in page. Easy to controll.\r\n.animated{\r\n  animation: none!important;\r\n} \r\n*/\r\n\r\n// ease-in-out to simulate the real velocity\r\n@keyframes jump{\r\n  0%, 100%{\r\n    transform: translateY(0);\r\n  }\r\n  50%{\r\n    // relative to the target element.\r\n    transform: translateY(-80%);\r\n  }\r\n}\r\n\r\n@keyframes spin{\r\n\t100%{transform:rotate(360deg);}\r\n}\r\n\r\n.dropIn {\r\n  animation: dropIn 0.4s ease-in;\r\n}\r\n@keyframes rotateFadeInRight {\r\n  from {\r\n    opacity: 0;\r\n    -webkit-transform: translate3d(100%, 0, 0);\r\n    transform: translate3d(200%, 0, 0) rotate(0);\r\n    transform-origin: center center;\r\n  }\r\n\r\n  to {\r\n    opacity: 1;\r\n    -webkit-transform: translate3d(0, 0, 0);\r\n    transform: translate3d(0, 0, 0) rotate(360deg);\r\n    transform-origin: center center;\r\n  }\r\n}\r\n@keyframes dropIn {\r\n  0% {\r\n    opacity: 0;\r\n    transform: translateY(-50px);\r\n  }\r\n  100% {\r\n    opacity: 1;\r\n    transform: translateY(0);\r\n  }\r\n}\r\n.dropUp{animation: dropIn 0.4s ease-in;}\r\n@keyframes dropUp {\r\n  0% {\r\n    opacity: 0;